import React from 'react'
import {Col, Container, Row} from "react-bootstrap";
import "./bottom-content.css"
import TextField from '@material-ui/core/TextField';

const BottomContent = () => {
    return (
        <div className="full-height mx-0 my-0 px-0 py-0" >
            <div className="fill-window">
        <Row className="full-xy " >
            <Col className="antiquewhite" lg={2}>1 of 1</Col>
            <Col lg={10}>
                <TextField fullWidth="true" className="mtextfield col-lg-10" label="" variant="filled" multiline/>
                {/*<textarea className="full-xy"></textarea>*/}
            </Col>
        </Row>
            </div>
    </div>)
};

export default  BottomContent;
